INSERT INTO `sections` VALUES (1,5,'section One',1,0,'HTML','Hladanie strateneho ?oklíka.','2010-12-04 22:35:01','2010-12-18 09:54:54','2010-12-21 00:00:00','2013-03-03 20:00:00'),(2,NULL,'Important',2,0,NULL,NULL,'2010-12-05 19:12:21','2010-12-05 19:12:21','0000-00-00 00:00:00','0000-00-00 00:00:00'),(4,NULL,'News',3,1,NULL,NULL,'2010-12-05 19:12:42','2010-12-05 19:12:42','0000-00-00 00:00:00','0000-00-00 00:00:00'),(5,1,'DECODOM',1,1,'HTML','DECODOM sa špecializuje na výrobu nábytku na báze drevotrieskovej dosky a vákuovo lisovanej fólie. Tento proces obsluhujú najmodernejšie technologické zariadenia a kvalifikovaní skúsení zamestnanci, ale aj absolventi stredných a vysokých škôl. Ak na konci roka 1999 firma zamestnávala 365 pracovníkov, dnešný počet už presahuje tisíc zamestnancov.','2010-12-05 19:12:53','2010-12-28 16:42:33',NULL,NULL),(8,1,'Úvod do sveta pekných vecí',2,1,'HTML','Navrhnite si sami kuchyňu podľa vlastných predstáv!\r\ndecoplanner je veľký interaktívny nástroj, ktorý vám pomôže naplánovať svoj priestor, vyskúšať nápady a sami uvidíte, ako vaša kuchyňa môže vyzerať. A to všetko z pohodlia vášho domova.','2010-12-05 21:47:34','2010-12-28 16:42:37','0000-00-00 00:00:00','0000-00-00 00:00:00'),(9,12,'Na vino',1,0,'text','super akcia','2010-12-18 15:47:58','2010-12-18 15:47:58',NULL,NULL),(10,12,'Dvojak',1,0,'text','Huraaaaa','2010-12-18 15:49:11','2010-12-18 15:49:11',NULL,NULL),(11,12,'Trojka v poradi',1,0,'text','Trojka v poradi','2010-12-18 15:49:36','2010-12-18 15:49:36',NULL,NULL),(12,6,'Dobry som',1,0,'HTML','Dobry som','2010-12-18 15:55:46','2010-12-18 15:55:46',NULL,NULL),(13,13,'Rival',1,0,'text','rival is cool','2010-12-19 07:22:10','2010-12-19 07:22:10',NULL,NULL),(14,29,'Added',1,0,'text','Addednew one','2010-12-19 07:23:30','2010-12-19 07:23:30',NULL,NULL),(15,29,'Hey jude',2,0,'text','is nice','2010-12-19 07:23:49','2010-12-19 07:23:49',NULL,NULL),(16,41,'Oh yes',1,0,'text','important things','2010-12-19 10:36:43','2010-12-19 10:37:14',NULL,NULL),(17,41,'What \'s up',2,0,'HTML','all from last 3 days','2010-12-19 10:37:07','2010-12-19 10:37:14',NULL,NULL),(18,17,'Led technika',1,0,'HTML','Ruby Arrays: select(), collect(), and map()\r\nAs a former Java developer and new to the concept of blocks, these API options seem perplexing at first.   They\'re not.  All three take a block.  How they use the block is what distinguishes them.  You should read the RDoc for yourself but, if you want a quick a dirty summary, continue reading this post.\r\n','2011-01-30 00:43:51','2011-01-30 00:43:51',NULL,NULL);
